from flask import Flask, request
from flask_restful import Resource, Api
import dicom
import base64

app = Flask(__name__)
api = Api(app)

class Predict(Resource):
	def get(self, base64str):
		return base64str

api.add_resource(Predict, '/<string:base64str>')

base64str = ''

# should avoid this file writing with a mimic, see later
fp = open('test.dcm', 'wb')
fp.write(base64.b64decode(base64str))
fp.close()

plan = dicom.read_file('test.dcm')
print(plan.pixel_array[0])

